import React from 'react'
import { BrowserRouter as Router, Link } from 'react-router-dom'

function Header() {
  return(
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/creopalette">Home</Link>
          </li>
        </ul>
      </div>
    </Router>
  )
}

export default Header;
